import Data from '../../../../db/db.json'
import { React, Component } from 'react'
import { withRouter } from 'react-router-dom'

class DataSet extends Component {
    state = {
        dataSet: null
    }

    getDataSet = (id) => {
        var idDataSet = parseInt(id);
        for (var ds in Data.dataSets) {
            if (Data.dataSets[ds].ObjectID === idDataSet) {
                console.log('I GOT IT HERE ')
                console.log(Data.dataSets[1])
                this.setState({ dataSet: Data.dataSets[idDataSet] });
                console.log(this.state);
            }
        }
    }

    render() {
        const { id } = this.props.match.params;

        this.getDataSet(id);
        console.log(this.state);
        return (
            <div className="DataSet">
                <p>Showing {this.state.dataSet.name}...</p>
                <p>This is where a dataset table will go, listing any data points that have been labeled. Also, maybe it will have a list of files included? IDK yet.</p>
            </div>
        );
    }
}

export default withRouter(DataSet);
